import React, { useEffect, useState } from "react";

const Home = () =>{

    const [haber,setHaber] =useState([])

    useEffect(() =>{
        const api_link="https://inshorts.deta.dev/news?category=sports"
        fetch(api_link)
        .then(hb=>hb.json())
        .then(hb=>{
            setHaber(hb.data)
        })
    })

    return(
        <div>
            {
                haber.map(hb=>
                    <div>
                        {hb.content}
                    </div>
                    )
            }
        </div>
    )
}

export default Home;
